  \"2013-03-16T00:34:14.504918\",\n\t\"name\": \"net-power-capacity-of-geothermal-wells-versus-reservoir-temperature-a-practical-perspective\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This paper investigates the practical range
  of net power capacity available from conventional and enhanced geothermal wells
  as a function of temperature and productivity index. For a temperature range of
  100C to 190C, which is the operating temperature limit of presently available downhole
  pumps, wells are typically pumped and power is usually generated in a binary-cycle
  plant, and in rare cases in a flash-cycle or hybrid-cycle plant. \",\n\t\"license_title\":
